This chunk of code is responsible for making sure that the object passed to addSatelliteConfig() is in fact a satellite config.

That's why addSatelliteConfig() can assume that all of the required fields will be populated and bail out towards the end if anything is missing.

Instead of adding validateSatelliteconfig(), I'd prefer you change addSatelliteConfig() to something like addHttpSatelliteConfig().  It would remain mostly unchanged in the sense that it's responsible for populating and validating an HTTP satellite config.

When adding RDE support in the future you'd add a check after this one which sees if we have an RDE config and act accordingly.  Something like : 

if (interface.first == "xyz.openbmc_project.Configuration.RdeSatelliteController")
{
    addRdeSatelliteConfig(rdePrefix, interface.second, satelliteInfo);
}

The addRdeSatelliteConfig() would populate and validate the satelliteConfig struct for RDE instead of HTTP.
